    <tr>
      <td>{content.contentid}</td>

      <td>{content.timeRequiredToCompleteTheCourse}</td>

      <td>{content.chapterContent}</td>
      <td>{content.courseChapterid}</td>
      <td><a href={content.contentLink}>{content.contentLink}</a></td>


      <td>
        <button
