          Content
        </button>

        {/* <button   onClick={() => {
            
            navigate('/delete-chapter',{ state: {id: chapter.courseChapterid } })
          }}
        
        className="btn btn-danger float-end">
            delete
          </button> */}

      </td>
    </tr>
  )
}

export default UserContenttRow
